import React,{Fragment} from 'react'
import reactDom from 'react-dom'
import Today from './Today'

function DeadlineOverlay({handleCloseDeadlineOverlay}) {
    
    const portal = document.getElementById('portal-2')
    
    return reactDom.createPortal(
        <Fragment>
            <div onClick={handleCloseDeadlineOverlay}></div>
            <Today handleCloseDeadlineOverlay={handleCloseDeadlineOverlay}/>
        </Fragment>
    ,portal)
}

export default DeadlineOverlay
